import "./portfolio.scss";

export default function Portfolio() {
  return (
    <div className="portfolio" id="portfolio">
      <h1>Portfolio</h1>
      <ul>
        <li>Featured</li>
        <li>Web App</li>
        <li>Design</li>
      </ul>
      <div className="container">
        <div className="item">
          {/* <img
            src="https://raw.githubusercontent.com/oddporson/tweeter/master/public/docs/tweeter-tablet-view.png"
            alt=""
          /> */}
          <h3>Tweeter</h3>
        </div>
      </div>
    </div>
  );
}
